Considerando que a Assistência Médica Intensiva possui uma rede de ar comprimido para abastecimento de seus leitos, sendo que o ar é fornecido através de uma central de produção de um módulo, por empresa terceirizada;

Considerando que a locação de compressores de ar comprimido em substituição ao fornecimento de ar comprimido através de cilindros apresenta vantagem financeira ao poder público, por apresentar maior economicidade por diminuir custos fixos e variáveis de serviços agregados ao fluxo de trabalho de produção e fornecimento adotados no fornecimento de ar comprimido através de cilindros, possibilitando substituir com melhor proveito toda logística permanente e periódica de recarga, transporte, instalação, manutenção e assistência técnica dos cilindros, para apenas instalação, montagem e manutenção no caso dos presentes autos de locação de compressores de ar comprimido, com periodicidade e custos bem menores que com o fornecimento através de cilindros;

Considerando que o fornecimento de Ar Comprimido nesta unidade hospitalar é de necessidade contínua que não pode sofrer interrupções em momento algum por ser insumo de tratamento de saúde imprescindível à recuperação do estado de saúde dos pacientes do SUS em diversos casos corriqueiros de enfermidades tratados pelas unidades públicas de saúde, a garantia da plenitude deste suprimento deve ser primada pelo gestor público.
